import React from 'react';
import './App.css';
import HomePage from './components/home-page';
import AppHeader from './components/app-header';

function App() {
  return (
    <div>
      <header>
        <p>
          <AppHeader/>
          <HomePage/>
        </p>
      </header>
    </div>
  );
}

export default App;
